import React from "react";
import cardData from "./CardsData";

export const Stocks = () => {
  return (
      <div>
        {cardData.map((data) => {
          return (
            <div>
              <Stock
                title={data.promoCards.title}
                image={data.promoCards.image}
                ButtonName={data.promoCards.ButtonName}
              />
            </div>
          );
        })}
      </div>
  );
};


const Stock = ({ title, image, ButtonName }) => {
  return (
    <table>
      <tbody>
        <tr>
          <td>
            <h5>{title}</h5>
          </td>
          <td>
            <h5>{image}</h5>
          </td>
          <td>
            <h4>{ButtonName}</h4>
          </td>
        </tr>
      </tbody>
    </table>
  );
};
